import React from "react";
import styles from "./Icon.module.css";

import Image from "next/image";

export const Icon = () => {
  return (
    <div>
      <Image src="/fotoAlex.jpg" alt="PPPP" width={50} height={30} />
      <p>Arriba se encuentra una imagen</p>
    </div>
  );
};
